  render() {
    return (
      <div>
        <Card title='基础按钮'>
          <Button type='primary'>habitat</Button>
          <Button >habitat</Button>
          <Button type='dashed'>habitat</Button>
          <Button type='danger'>habitat</Button>
          <Button disabled type='danger'>habitat</Button>
        </Card>
      </div>
    )
  }
}
